const DarkBTN = document.getElementById('darkModeToggle');
DarkBTN.addEventListener('click', function() {
    document.documentElement.classList.toggle('dark');
    if (DarkBTN.innerText == 'Dark')
        DarkBTN.innerText = 'Light';
    else
        DarkBTN.innerText = 'Dark';
});


document.addEventListener("DOMContentLoaded", function() {
    const alertTableBody = document.getElementById('alertTable').querySelector('tbody');
    

    
    if (typeof alertData !== 'undefined' && alertData.length > 0) {
        
        alertData.forEach(alert => {
            const row = document.createElement('tr');
            row.classList.add('border-b', 'border-gray-200', 'hover:bg-gray-100', 'dark:hover:bg-white', 'dark:hover:text-black');
            row.innerHTML = `
                <td class="py-3 px-6 text-left">${new Date(alert.timestamp).toLocaleString()}</td>
                <td class="py-3 px-6 text-left">${alert.src_ip}</td>
                <td class="py-3 px-6 text-left">${alert.dest_ip}</td>
                <td class="py-3 px-6 text-left">${alert.alert.signature}</td>
                <td class="py-3 px-6 text-left">${alert.alert.category}</td>
                <td class="py-3 px-6 text-left">${alert.alert.severity}</td>
            `;
            alertTableBody.appendChild(row);
        });

        
        const categories = {};
        alertData.forEach(alert => {
            const category = alert.alert.category;
            if (!categories[category]) {
                categories[category] = 0;
            }
            categories[category]++;
        });


        const ctx2 = document.getElementById('alertChart2').getContext('2d');
        new Chart(ctx2, {
            type: 'pie',
            data: {
                labels: Object.keys(categories),
                datasets: [{
                    label: 'Alert Categories',
                    data: Object.values(categories),
                    backgroundColor: [
                        'rgba(255, 99, 132, 0.2)',
                        'rgba(54, 162, 235, 0.2)',
                        'rgba(255, 206, 86, 0.2)',
                        'rgba(75, 192, 192, 0.2)',
                        'rgba(153, 102, 255, 0.2)',
                        'rgba(255, 159, 64, 0.2)'
                    ],
                    borderColor: [
                        'rgba(255, 99, 132, 1)',
                        'rgba(54, 162, 235, 1)',
                        'rgba(255, 206, 86, 1)',
                        'rgba(75, 192, 192, 1)',
                        'rgba(153, 102, 255, 1)',
                        'rgba(255, 159, 64, 1)'
                    ],
                    borderWidth: 1
                }]
            },
            options: {
                responsive: true,
                plugins: {
                    legend: {
                        position: 'top',
                    },
                    tooltip: {
                        enabled: true,
                    }
                }
            }
        });

        const ctx = document.getElementById('alertChart').getContext('2d');
        new Chart(ctx, {
            type: 'bar',
            data: {
                labels: Object.keys(categories),
                datasets: [{
                    label: 'Alert Categories',
                    data: Object.values(categories),
                    backgroundColor: [
                        'rgba(255, 99, 132, 0.2)',
                        'rgba(54, 162, 235, 0.2)',
                        'rgba(255, 206, 86, 0.2)',
                        'rgba(75, 192, 192, 0.2)',
                        'rgba(153, 102, 255, 0.2)',
                        'rgba(255, 159, 64, 0.2)'
                    ],
                    borderColor: [
                        'rgba(255, 99, 132, 1)',
                        'rgba(54, 162, 235, 1)',
                        'rgba(255, 206, 86, 1)',
                        'rgba(75, 192, 192, 1)',
                        'rgba(153, 102, 255, 1)',
                        'rgba(255, 159, 64, 1)'
                    ],
                    borderWidth: 1
                }]
            },
            options: {
                responsive: true,
                plugins: {
                    legend: {
                        position: 'top',
                    },
                    tooltip: {
                        enabled: true,
                    },
                    // Apply dark mode styles if enabled
                    ...(document.documentElement.classList.contains('dark') && {
                        plugins: {
                            tooltip: {
                                backgroundColor: '#1f2937',
                                titleFontColor: '#f9fafb',
                                bodyFontColor: '#f9fafb',
                                borderColor: '#374151'
                            }
                        },
                        datasets: [{
                            backgroundColor: [
                                'rgba(255, 99, 132, 0.2)',
                                'rgba(54, 162, 235, 0.2)',
                                'rgba(255, 206, 86, 0.2)',
                                'rgba(75, 192, 192, 0.2)',
                                'rgba(153, 102, 255, 0.2)',
                                'rgba(255, 159, 64, 0.2)'
                            ].map(color => adjustColorBrightness(color, -20)),
                            borderColor: [
                                'rgba(255, 99, 132, 1)',
                                'rgba(54, 162, 235, 1)',
                                'rgba(255, 206, 86, 1)',
                                'rgba(75, 192, 192, 1)',
                                'rgba(153, 102, 255, 1)',
                                'rgba(255, 159, 64, 1)'
                            ].map(color => adjustColorBrightness(color, -20)),
                        }]
                    })
                }
            }
        });
    } else {
        console.warn('alertData is undefined or empty');
    }
});

